const Comments = () => {
    return <div>
        <form>
          <label htmlFor="username">Username</label>
          <input type="text" id="username" />
          <label htmlFor="body">Comment</label>
          <input type="text" id="body" />
          <button type="submit">Add Comment</button>
        </form>
        <p>Comments here</p>
      </div>;
};

export default Comments;
